import React from 'react'
import './time.scss'
import MyTitle from '../../MyTitle/MyTitle'

const Time = () => {
  return (
    <div className='mainContent__time'>
      <MyTitle>Wel wel wel!</MyTitle>
    </div>
  )
}

export default Time
